window.bookSummaryJSON = "Sam Bagshott, son of the late Boko Bagshott, had been at Blandings Castle only a short while, but long enough to know that anyone enjoying its hospitality must get the occasional shock. Sam braced himself as the possibilities flitted through his mind. The house was on fire? Empress of Blandings had taken to the bottle again? Constable Evans had arrived with a search warrant? There was a wide area of speculation, and he was prepared for bad news in any form. In any form, that is to say, except the one in which it came."; 
